import React from "react";

export default function Goods(props) {
  const { id, name, description, image,icon,full_background } = props;
  return (
    <>
      <div className="col s12 m4 l3">
        <div className="card">
          <div
            className="card-image "
            style={{ width: "100%", height: "300px" }}
          >
            <img
              style={{
                width: `calc(100%)`,
                height: "100%",
                padding: "0",
                boxSizing: "border-box",
              }}
              src={
                full_background
                  ? full_background
                  : "https://media.fortniteapi.io/images/cosmetics/7633c11441e0b69aa8d13013ba1c6f39/v2/MI_Bundle_Featured_TreyCozyFemale/background.png"
              }
              alt="shop"
            />
            <a
              href="#!"
              className="btn-floating halfway-fab waves-effect waves-light red"
            >
              <i className="material-icons">add</i>
            </a>
          </div>
          <div className="card-content">
            <span>{name}</span>
            <p>
             {description}
            </p>
          </div>
        </div>
      </div>
    </>
  );
}
